import "./App.css";
import Demo from "./Demo";
import {
  Container,
  Row,
  Col,
  InputGroup,
  FormControl,
  Button,
} from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <InputGroup className="mb-3">
        <FormControl
          placeholder="Recipient's username"
          aria-label="Recipient's username"
          aria-describedby="basic-addon2"
        />
        <InputGroup.Append>
          <Button variant="outline-secondary">Button</Button>
        </InputGroup.Append>
      </InputGroup>
      <Container>
        <Row>
          <Col>1 of 3</Col>
        </Row>
        <Row>
          <Col>1 of 3</Col>
        </Row>
        <Row>
          <Col>1 of 3</Col>
        </Row>
      </Container>
      {/* <Demo /> */}
    </div>
  );
}

export default App;
